function Slider({ slides }) {

    slides.forEach(i => {
        console.log(i.id)
    });
    return (
        <div>
            {slides ? slides.map((i, id) => (<img key={id} src={i.image} alt='' width='300px' />)) : null}
        </div>
    )
}

export default Slider
